interface IProps extends IBaseProps {
  rowIndex: number;
  width: number;
}
interface IState {
  previousChromosomeState: ChromosomeState;
}

const animationTime = 3000;

@inject("stores")
@observer
export class StaticNucleusView extends BaseComponent<IProps, IState> {

  public state = {
    previousChromosomeState: "expanded" as ChromosomeState
  };

  public componentWillMount() {
    onAction(this.stores.organisms, this.updatingModel);
  }

  public render() {
    const { width } = this.props;
    const sex = this.row.organismsMouse!.backpackMouse.sex;
    const sexChromosome = sex === "male" ? "y" : "x2";

    const nucleusStyle: React.CSSProperties = {
      backgroundImage: "linear-gradient(#53B4AF, #3f9a95)"
    };
    if (width) {
      nucleusStyle.width = `${width}px`;
    }

    // we want element to completely re-render to reset elements "presentation time", which the
    //  animation's "dur" attribute is based on.
    const randKey = "svg" + Math.random();

    return (
      <div className="organism-view-container">
        <div className="organism-view" style={nucleusStyle} data-test="nucleus-view">
          <svg key={randKey} id="Chromatin_Paths" data-name="Chromatin Paths" viewBox="0 0 394 182" xmlns="http://www.w3.org/2000/svg">
            {[
              this.getChromososome("c2a"),
              this.getChromososome("c2b"),
              this.getChromososome("c8a"),
              this.getChromososome("c8b"),
              this.getChromososome("x1"),
              this.getChromososome(sexChromosome),
            ]}
          </svg>
        </div>
      </div>
    );
  }

  private startAnimation = () => {
    (window as any).setTimeout(() => {
      this.setState({previousChromosomeState: this.chromosomeState});
    }, animationTime);
  }

  private updatingModel = (action: ISerializedActionCall) => {
    const { rowIndex } = this.props;
    if (action.name === "toggleNucleusCondense" && action.path === `/rows/${rowIndex}`) {
      this.startAnimation();
    }
  }

  private getChromososome = (chromId: ChromId) => {
    const mouseChomId = this.mouseId + chromId;
    const coloredState = this.row.nucleusColored ? "colored" : "decolored";

    let color;

    if (coloredState === "decolored") {
      color = "#ffbf25";
    } else if (chromId.indexOf("c2") > -1) {
      color = "#19d119";
    } else if (chromId.indexOf("c8") > -1) {
      color = "#ba37e0";
    } else {
      color = "#dbdb22";
    }

    const chromosomeStyle = {
      fill: "none",
      stroke: color,
      strokeMiterlimit: 10,
      strokeWidth: "1.5px"
    };

    const chromosomeDef = Chromosomes[this.chromosomeState];

    if (this.chromosomeState !== this.state.previousChromosomeState) {
      const previousChromosomeDef = Chromosomes[this.state.previousChromosomeState];
      return (
        <React.Fragment key={mouseChomId}>
          <path id={mouseChomId} data-name={chromId} d={previousChromosomeDef[chromId]} style={chromosomeStyle}/>
          <animate xlinkHref={"#" + mouseChomId} attributeName="d" attributeType="XML"
            from={previousChromosomeDef[chromId]}
            to={chromosomeDef[chromId]}
            dur={(animationTime / 1000) + "s"} fill="freeze" />
        </React.Fragment>
      );
    } else {
      return <path key={mouseChomId} id={mouseChomId} data-name={chromId} d={chromosomeDef[chromId]} style={chromosomeStyle}/>;
    }
  }

  get row() {
    const { organisms } = this.stores;
    const { rowIndex } = this.props;
    return organisms.rows[rowIndex];
  }

  get mouseId() {
    return this.row.organismsMouse!.backpackMouse.id;
  }

  get chromosomeState(): ChromosomeState {
    return this.row.nucleusCondensed ? "condensed" : "expanded";
  }
}
